import React from 'react'

function LikedVideos() {
  const history = [
    {
      _id: 1,
      video_src: vid,
      Channel: "62bafe6752cea35a6c30685f",
      title: "video 1",
      Uploader: "abc",
      description: "description of video 1"
    },
    {
      _id: 2,
      video_src: vid,
      Channel: "cdd",
      title: "video 2",
      Uploader: "abc",
      description: "description of video 2"
    },
    {
      _id: 3,
      video_src: vid,
      Channel: "add",
      title: "video 3",
      Uploader: "abc",
      description: "description of video 3"
    },
    {
      _id: 4,
      video_src: vid,
      Channel: "prod",
      title: "video 4",
      Uploader: "abc",
      description: "description of video 4"
    }
  ]
  return (
    <WHL page={"Watch History"} videoList={history} />
  )
}

export default LikedVideos
